@ElliotAvidane @brokemoney84 @NFTherder @TheHumanoidsNFT What part of these claims are flase?

Is the metadata not stored on someone's github account? 

Is the actual asset not stored on a central storage, retrieved by their own api?

@brokemoney84 @NFTherder @TheHumanoidsNFT Lmfao if the domain expires, then it's a rug.

You'd be pointing to a domain that no longer exists and maps to a resolvable address.

The "dev" should look up what DNS is.

@ryder_ripps Passwords do not use encryption. They are encrypted before being stored centrally.

This is extremely differently than private &amp; public keys, which are generated via some cryptography algorithm.

Your Twitter password is not owned by you.

@ryder_ripps No that's not right.

Authentication in web3 is based on user owned, cryptographic generated private &amp; public keys. 

You own your keys. This is completely different than a username and password, which is stored directly on a centrally owned data storage.

